import React from "react";

import { DialogItem } from "../";

import "./Dialogs.scss";

const Dialogs = ({ items }) => (
  <div className="dialogs">
    <DialogItem
      user={{
        fullname: "Fedor Dostoevskiy",
        isOnline: true
      }}
      unreaded={999}
    />
  </div>
);

export default Dialogs;
